enum Status {
    Active,
    Inactive,
    Pending
}

class Task {
    private title: string;
    private status: Status;

    constructor(title: string) {
        this.title = title;
        this.status = Status.Pending;
    }

    setStatus(status: Status): void {
        this.status = status
    }

    isActive(): boolean {
        return this.status === Status.Active;
    }
}

package main

import "strconv"

type StringProcessor struct {
    text string
}

func (sp *StringProcessor) ParseInt() int {
    num, err := strconv.Atoi(sp.text)
    if err != nil {
        return 0
    }
    return num
}

func (sp *StringProcessor) ParseFloat() float64 {
    num, err := strconv.ParseFloat(sp.text, 64)
    return num
}

